import React from "react";
import "../stylesheets/App.scss";
import PokeList from "./Pokelist";
import pokemonData from "../pokemonData/.json";

const App = () => {
  return (
    <div className="App">
      <h1 className="title"> Mis clubes favoritos</h1>
      <Pokelist pokemonData={pokemonData} />
    </div>
  );
};

export default App;
